import React from 'react';
import Container from './Container.js'
import Header from './Header'
import H1 from './H1'


class Home extends React.Component {
	render() {
		return(
			<Container>
				<Header>
					<H1 big>MY TABLETOP HERO</H1>
					<p>Begin your fable right. Be a tabletop hero.</p>
				</Header>
			</Container>
		);
	}

}

export default Home;
